import { FETCH_USER } from "../actions/type";

const initialState = {
        data : [],
};

const fetchUserReducer = (state = initialState, action) =>{
    switch(action.type){
        case FETCH_USER:
            return {
                ...state,
                data : [ ...state.data, action.massage ],
            };
        default :
            return  state;
    }
}

export default fetchUserReducer;
